  return (
    <>
    <div className="buyers-container">
      {/* Heading Section */}
      <div className="buyers-heading">
        <h2>Pre√ßos Simples e Transparentes</h2>
        <p>
          Seja sua primeira aquisi√ß√£o ou voc√™ j√° adquira regularmente, temos o plano certo para voc√™.
        </p>
      </div>

      {/* Pricing Cards */}
